import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <section id="menu">
    <div className="button">Overview</div> 
    <div className="button">Export</div> 
    <div className="button">Detailed View</div> 
    <div className="button">Voting</div>
</section>
      </header>
    </div>
  );
}

export default App;
